import React from 'react'
import { Base } from '../types';

interface InputProps extends Base {
    placeHolder: string;
    type: string;
    onChange: (e: React.ChangeEvent<HTMLInputElement>) => void
}

const Input: React.FC<InputProps> = ({ className, placeHolder, type, onChange }) => {
    return (
        <div>
            <input className={className ? `vds-btn ${className}` : 'vds-btn'} placeholder={placeHolder} type={type} onChange={onChange} />
        </div>
    )
}

export default Input
